import React, { useState, useEffect } from "react";
import { MailOutlined, CloseCircleOutlined } from "@ant-design/icons";
import { Divider, Menu } from "antd";
import { Space, Layout, Button, Popover } from "antd";
import { Card, Col, Row } from "antd";
import { Progress, Avatar } from "antd";
import { Rate } from "antd";
import { HomeOutlined, EditOutlined } from "@ant-design/icons";
import axios from "axios";
import Header from "../dashboard/Header";
import Sidebar from "../dashboard/Sidebar";
import Content from "../dashboard/Content";
import NewContent from "../dashboard/NewContent";
//https://ant.design/components/layout
//const { Header, Footer, Sider, Content } = Layout;

const Navs = () => {
  const [tickets, setTicket] = useState([]);
  const contents = (
    <div>
      <p>Content</p>
      <p>Content</p>
    </div>
  );
  useEffect(() => {
    const getTicket = async () => {
      const response = await axios.get("http://localhost:8000/ticket");
      if (response.data.tickets.length > 0) {
        let res = response.data.tickets;
        setTicket(res);
      }
    };
    getTicket();
  }, []);

  return (
    <div>
      <body>
        <Header></Header>
        <div>
          <Sidebar></Sidebar>
        </div>
        <div>
          <NewContent></NewContent>
        </div>
      </body>
    </div>
  );

  
};
export default Navs;
